import javax.xml.xpath.*
import groovy.xml.StreamingMarkupBuilder
import groovy.lang.Binding;
import groovy.lang.Script;
import java.time.LocalDateTime
import java.time.format.DateTimeFormatter

// Rcuprer le contenu de la requte
def requestContent = mockRequest.requestContent

try {
    // Analyser le contenu de la requte XML
    def request = new XmlSlurper().parseText(requestContent)

    // Rcuprer le customerCode de la requte
    def customerCode = request.Body.getCustomerDetailRequestFlow.getCustomerDetailRequest.customerIdentifier.customerCode.text().toLong()

    // Votre dictionnaire de donnes
    def dataDictionary = [
        'langNb': ['001', '001', '002'],
        'lang': ['Fran', 'Fran', 'Eng'],
        'cli': ['500640', '500642', '500643'],        
        'nom': ['NOHAILA', 'HIND', 'MOHAMED'],
        'nametoreturn': ['rest500640', 'rest500642', 'rest500643'],       
        'lib': ['01', '01', '03'],
        'sext': ['Madame', 'Madame', 'Monsieur'],

    ]

    // Rechercher le customerCode dans le dictionnaire et rcuprer les donnes correspondantes
    def index = dataDictionary['cli'].indexOf(customerCode.toString())

    // Vrifier si le customerCode a t trouv dans le dictionnaire
    if (index != -1) {
        // Rcuprer les donnes correspondantes
        def langNbValue = dataDictionary['langNb'][index]
        def langValue = dataDictionary['lang'][index]
        def nomValue = dataDictionary['nom'][index]
        def nametoreturnValue = dataDictionary['nametoreturn'][index]       
        def libValue = dataDictionary['lib'][index]
        def sextValue = dataDictionary['sext'][index]


        // Dfinir les variables correspondantes dans le contexte SoapUI
        context.langNb = langNbValue
        context.lang = langValue 
        context.cli = customerCode
        context.nom = nomValue
        context.nametoreturn = nametoreturnValue              
        context.lib = libValue
        context.sext = sextValue

    } else {
        log.error("Le customerCode n'a pas t trouv dans le dictionnaire.")
    }
} catch (Exception ex) {
    log.error("Une erreur s'est produite : ${ex.message}", ex)
}
